import React from "react";
import './filter.css';


export default function Filter() {
  return (
    <div className="filter-item">
      <label>
        <input type="checkbox" />
        <span>
        <svg xmlns="http://www.w3.org/2000/svg" width="21" height="21" viewBox="0 0 21 21" fill="none">
          <rect x="1.24133" y="0.912689" width="18.7414" height="19.1587" rx="1.5" stroke="#9ABBCE"/>
        </svg>
        </span>
      </label>
      <div>N пересадок</div>
    </div>
  );
}
